/* global describe, it, beforeEach, expect, spyOnProperty, fail */

import { IndexedDbStorageService as Service } from '../../../../sources/webapp/scripts/api/storage/indexeddb.js'

const dbname = 'testDbName'

beforeEach((done) => {
  const deleteRequest = indexedDB.deleteDatabase(dbname)
  deleteRequest.onerror = (error) => {
    console.error(`Error deleting test database: ${error}`)
    done()
  }
  deleteRequest.onsuccess = () => done()
})

describe('Class "IndexedDbStorageService"', () => {
  describe('Constructor', () => {
    it('should be predifine constructor parameters', () => {
      const service = new Service()
      expect(service._databaseName).toBeDefined()
      expect(service._databaseVersion).toBeDefined()
    })
  })

  describe('Compatibility property', () => {
    it('should be compatible if IDBFactory is available in environment', () => {
      const service = new Service()
      expect(service.compatible).toBe(!!indexedDB)
      spyOnProperty(window, 'indexedDB', 'get').and.returnValue(undefined)
      expect(service.compatible).toBe(false)
    })
  })

  describe('Open database connection', () => {
    it('should open a connection', (done) => {
      const service = new Service(dbname, 1)
      service.createConnection()
        .then(() => done())
        .catch((error) => {
          fail(`It isn't expected to fail creating a database connection: ${error}`)
        })
    })
  })

  describe('Update process for database', () => {
    it('should call the update method', (done) => {
      const service = new Service(dbname, 1)
      service.createConnection()
        .then((iDbDatabase) => {
          expect(iDbDatabase.name).toBe(dbname)
          expect(iDbDatabase.version).toBe(1)
          expect(iDbDatabase.objectStoreNames.contains('files')).toBeTrue()
          expect(iDbDatabase.objectStoreNames.contains('episodes')).toBeTrue()
          expect(iDbDatabase.objectStoreNames.contains('sources')).toBeTrue()
          const episodeStore = iDbDatabase.transaction(['episodes'], 'readonly').objectStore('episodes')
          expect(episodeStore.indexNames.contains('status')).toBeTrue()
          expect(episodeStore.indexNames.contains('sources')).toBeTrue()
          // TODO how can I check the internals of the database?
          done()
        })
        .catch((error) => {
          fail(`It isn't expected to fail setting up a database: ${error}`)
        })
    })
  })

  describe('Operations on files', () => {
    describe('Saving files', () => {
      it('should saving a file represented by a array buffer', (done) => {
        const service = new Service()
        const content = Uint8Array.from(atob(contentBase64), c => c.charCodeAt(0)).buffer
        service.saveFile('http://podcatcher.example/TestSavingFile.ogg', content, 'audio/oga')
          .then((id) => {
            expect(id).toBe('http://podcatcher.example/TestSavingFile.ogg')
            done()
          })
          .catch((error) => {
            fail(`It isn't expected to fail saving a file: ${error}`)
            done()
          })
      })

      it('should saving a file represented by a blob', (done) => {
        const service = new Service()
        const content = new Blob(['Hello World! Podcasting is a realy nice thing.'], { type: 'text/plain' })
        service.saveFile('http://podcatcher.example/TestSavingFile.txt', content)
          .then((id) => {
            expect(id).toBe('http://podcatcher.example/TestSavingFile.txt')
            done()
          })
          .catch((error) => {
            fail(`It isn't expected to fail saving a file: ${error}`)
            done()
          })
      })
    })
  })
})

const contentBase64 = ''
